import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, FlatList } from 'react-native';
import { useNavigate } from 'react-router-dom';
import arrow from "./AlwaysActive/images/arrow.png";
import { personList,exponateList } from '../Application/Classes/testDataGenerator';

const persons = personList;
const exponate = exponateList;
//const auctions = auctionList; TODO

const Home = () => {
    const [hoveredIndex, setHoveredIndex] = useState(null);
    const navigate = useNavigate();

    const handleNavigation = (route) => {
        navigate(route);
    };

    const handleHover = (index) => {
        setHoveredIndex(index);
    };

    const renderPerson = ({ item, index }) => (
        <View
            style={{ width: 400, flexDirection: "row" }}
            key={index}
            onMouseEnter={() => handleHover(index)}
            onMouseLeave={() => handleHover(null)}
        >
            <View style={stylesTexts.simpleListItem}>
                <View style={{ flexDirection: "row", width: 400 }}>
                    <Text style={{ fontWeight:"bold",fontSize: 12 , color:"rgba(33,33,33,1)"}}>
                        {item.nachname}
                    </Text>
                    <Text> </Text>
                    <Text style={{fontSize: 12}}
                    >{item.vorname}</Text>
                </View>
            </View>
        </View>
    );

    const renderExpon = ({ item, index }) => (
        <View
            style={{ width: 400, flexDirection: "row" }}
            key={index}
            onMouseEnter={() => handleHover(index)}
            onMouseLeave={() => handleHover(null)}
        >
            <View style={stylesTexts.simpleListItem}>
                <View style={{ flexDirection: "row", width: 1000 }}>
                    <Text style={{ width:100,fontWeight:"bold",fontSize: 12 , color:"rgba(33,33,33,1)"}}>
                        {item.exponatId}
                    </Text>
                    <Text style={{fontSize: 12,width:180}}>{item.titel}</Text>
                    <Text style={{fontSize: 12,width:100}}>{item.kategorie}</Text>
                    <Text style={{fontSize: 12,width:100}}>{item.masse}</Text>
                    <Text style={{fontSize: 12,width:100}}>{item.gewicht}</Text>
                    <Text style={{fontSize: 12,width:300}}>{item.kommentar}</Text>
                </View>
            </View>
        </View>
    );

    return (
        <View style={stylesContainers.container}>
            <View style={stylesContainers.welcomeView}>
                <Text style={stylesTexts.welcomeText}>Willkommen!</Text>
            </View>
            <View style={stylesContainers.diffcont}>
                <View style={stylesContainers.viewListExponate}>
                    <View>
                        <View style={{ flexDirection: "row", marginLeft:20, marginRight:20, marginTop: 20 }}>
                            <Text style={stylesTexts.titleOfLists}>Exponate</Text>
                            <View style={{ paddingLeft: 850 }}>
                                <TouchableOpacity onPress={() => handleNavigation("/exponate")}>
                                    <Image style={stylesTexts.images} source={arrow} />
                                </TouchableOpacity>
                            </View>
                        </View>
                    </View>
                    <View style={{ marginLeft:20, marginRight:20, marginTop: 3 }}>
                        <View style={{flexDirection:"row"}}>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>ID</Text>
                            <Text style={[stylesTexts.listValueName, { width: 180 }]}>Titel</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Kategorie</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Masse</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Gewicht</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Kommentar</Text>





                        </View>
                        <View style={{height: 230,marginTop:3 }}>
                            <FlatList
                                data={exponate}
                                renderItem={renderExpon}  // Render jede Person
                                keyExtractor={(item, index) => index.toString()}
                                initialNumToRender={10}   // Zeige die ersten 10 Elemente an
                                maxToRenderPerBatch={10}  // Maximal 10 Elemente gleichzeitig rendern
                                windowSize={5}            // Fenstergröße für das virtuelle Rendering
                            />
                        </View>
                    </View>
                </View>
                <View style={stylesContainers.viewListPersonen}>
                    <View>
                        <View style={{ flexDirection: "row", marginLeft:20, marginRight:20, marginTop: 20 }}>
                            <Text style={stylesTexts.titleOfLists}>Personen</Text>
                            <View style={{ paddingLeft: 150 }}>
                                <TouchableOpacity onPress={() => handleNavigation("/persons")}>
                                    <Image style={stylesTexts.images} source={arrow} />
                                </TouchableOpacity>
                            </View>
                        </View>
                    </View>
                    <View style={{ marginLeft:20, marginRight:20, marginTop: 3 }}>
                        <Text style={stylesTexts.listValueName}>Name </Text>
                        <View style={{height: 230,marginTop:3 }}>
                            <FlatList
                                data={persons}
                                renderItem={renderPerson}  // Render jede Person
                                keyExtractor={(item, index) => index.toString()}
                                initialNumToRender={10}   // Zeige die ersten 10 Elemente an
                                maxToRenderPerBatch={10}  // Maximal 10 Elemente gleichzeitig rendern
                                windowSize={5}            // Fenstergröße für das virtuelle Rendering
                            />
                        </View>
                    </View>
                </View>
            </View>
            <View style={stylesContainers.viewListAuktionen}>
                <View>
                    <View style={{ flexDirection: "row", marginLeft:20, marginRight:20, marginTop: 20 }}>
                        <Text style={stylesTexts.titleOfLists}>Auktionen</Text>
                        <View style={{ paddingLeft: 1175 }}>
                            <TouchableOpacity onPress={() => handleNavigation("/auction")}>
                                <Image style={stylesTexts.images} source={arrow} />
                            </TouchableOpacity>
                        </View>
                    </View>
                </View>
                <View style={{ marginLeft:20, marginRight:20, marginTop: 3 }}>
                    <Text style={stylesTexts.listValueName}>Name </Text>
                    <View style={{height: 230,marginTop:3 }}>
                        <FlatList
                            data={persons}
                            renderItem={renderPerson}  // Render jede Person
                            keyExtractor={(item, index) => index.toString()}
                            initialNumToRender={10}   // Zeige die ersten 10 Elemente an
                            maxToRenderPerBatch={10}  // Maximal 10 Elemente gleichzeitig rendern
                            windowSize={5}            // Fenstergröße für das virtuelle Rendering
                        />
                    </View>
                </View>
            </View>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        width: 1350,
        paddingLeft: 20
    },
    diffcont: {
        flexDirection: "row",
        padding: 20
    },
    viewListExponate: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        paddingLeft: 10,
        paddingRight: 10,
        height: 300,
        width: 1000,
        margin: 10
    },
    viewListPersonen: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        paddingLeft: 10,
        paddingRight: 10,
        height: 300,
        width: 300,
        margin: 10
    },
    viewListAuktionen: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        height: 300,
        width: 1325,
    },
    welcomeView: {
        paddingTop: 40,
        paddingBottom: 20,
    },
    simpleList: {
        padding: 10,
        borderRadius: 5,
        width: '100%',
    },
});

const stylesTexts = StyleSheet.create({
    welcomeText: {
        color: 'rgba(240,175,77,1)',
        fontWeight: "bold",
        fontSize: 50,
    },
    titleOfLists: {
        color: 'rgba(141,69,85,1)',
        fontWeight: "bold",
        fontSize: 17
    },
    listValueName: {
        fontWeight: "bold",
        fontSize: 14
    },
    images: {
        width: 20,
        height: 20,
    },
    simpleListItem: {
        flexDirection: "row",
        fontSize: 16,
        paddingVertical: 5,
        borderBottomWidth: 1,
        borderBottomColor: '#ddd',
    },
});

export default Home;
